// import type { Theme } from "theme-ui";
const theme = {
    initialColorMode: "light",
    colors: {
      text: "black",
      background: "white",
      primary: "#1408e6",
      inverseText: "blue",
      modes: {
        dark: {
          text: "white",
          background: "#282c34",
          primary: "#8fceff",
          inverseText: "green",
        },
      },
    },
  };
  
  export default theme;
